  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0109904 includes chemical,
  physical and time series data collected from MOORINGS in the Gray's Reef National
  Marine Sanctuary and North Atlantic Ocean from 2006-07-18 to 2013-01-22. These data
  include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN
  - PERCENT SATURATION, Partial pressure (or fugacity) of carbon dioxide - atmosphere,
  Partial pressure (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE
  TEMPERATURE. The instruments used to collect these data include Bubble type equilibrator
  for autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese
  data were collected by Jeremy Mathis, Adrienne Sutton, Christopher Sabine, Sylvia
  Musielewicz, Stacy Maenner and Adrienne J. Sutton of US DOC; NOAA; OAR; Pacific
  Marine Environmental Laboratory as part of the Mooring GraysRf_81W_31N, Mooring_GraysRf_81W_31N_Sep2010_Sep2011,
  Mooring_GraysRf_81W_31N_Sep2011_Sep2012 and Mooring_GraysRf_81W_31N_Sep2012_Jan2013
  data set. CDIAC assigned the following cruise ID(s) to this data set: GRRF20060718,
  Gray20100916, Gray20110930 and Gray20120919.nnThe Global CO2 Time-series and Moorings
  Project involves international groups from 18 countries who have mounted sensors
  on moored buoys to provide high resolution time-series measurements of atmospheric
  boundary layer and surface ocean CO2 partial pressure (pCO2). The CO2 Time-series
  and Moorings Project is coordinated by UNESCO International Ocean Carbon Coordination
  Project (IOCCP).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
